import React from 'react';
import Header from './header.js';

function Search_conts({list}) {
    return (
        <div class="div2">
            <ul>
            {list && list.map((str) => {
            return (
                <li>{str}</li>
            );
            })}
            </ul>   
        </div>
    )
      
}


export default Search_conts;
